define({"topics" : [{"title":"VoIP Trunk Codec Settings","shortdesc":"\n                     <p class=\"shortdesc\">Each new created VoIP trunk has a default preferred codec list. However, the default         codec list may not match the\n                        codecs supported by your SIP trunk provider. In order to         maximize the quality of calls and the amount of bandwidth\n                        used for calls, youâ€™ll want to         choose and configure your preferred codec list to match the settings that your SIP\n                        trunk         provider supports. \n                     </p>\n                  ","id":"topic_ez2_k2f_2fb","href":"topic\/voip_trunk_codec_settings.html","menu": {"hasChildren":false,},"tocID":"topic_ez2_k2f_2fb-d46e7723","topics":[]},{"title":"VoIP Trunk Advanced Settings","shortdesc":"\n                     <p class=\"shortdesc\">The advanced settings of VoIP trunk requires professional knowledge of SIP protocol.         Incorrect configurations may\n                        cause calling issues.\n                     </p>\n                  ","id":"topic_hhj_wld_2fb","href":"topic\/voip_trunk_advanced_settings.html","menu": {"hasChildren":false,},"tocID":"topic_hhj_wld_2fb-d46e7792","topics":[]},{"title":"Set up DOD Numbers on VoIP Trunk","shortdesc":"\n                     <p class=\"shortdesc\">DOD (Direct Outwards Dialing) is the caller ID of associated extensions that will be         displayed when making outbound\n                        calls. You can bind one DOD number to one extension or one         DOD number to multiple extensions. \n                     </p>\n                  ","id":"task_rrh_vgf_2fb","href":"topic\/set_up_dod_numbers_on_voip_trunks.html","menu": {"hasChildren":false,},"tocID":"task_rrh_vgf_2fb-d46e7861","topics":[]}]});